import React from 'react';

import "./coding.css"

import MyButton from "./MyButton";

function CodingCard(props) {
    return (
        <div>
            <article className="postcard dark blue">
                <a className="postcard__img_link" href="https://www.youtube.com/watch?v=GWPyif09xDE" target="blank">
                    <img className="postcard__img" src={props.imgSrc} alt="projectImg"/>
                </a>
                <div className="postcard__text">
                    <h1 className="postcard__title blue"><a href="https://www.youtube.com/watch?v=GWPyif09xDE"
                                                            target="blank">{props.projectName}</a></h1>
                    <div className="postcard__subtitle small">Javascript Game
                    </div>
                    <div className="postcard__bar"></div>
                    <div className="postcard__preview-txt">{props.projectDescription}
                    </div>
                    <MyButton btnText={"View Demo"}></MyButton>
                </div>
            </article>
        </div>
    );
}

export default CodingCard;
